package overloading;

public class OperatorOverliading {
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(10+30);//40
		System.out.println(10 +20 +"radhakrishana");//30radhakrishna
		System.out.println("radha "+"krishana"+20 +20);//radha krishana2020
		System.out.println("radha "+20 +20+"krishana");//radha 2020krishana

	}

}
